import React from 'react';
import QrReader from 'react-qr-reader';

const Add = ({database, onReload}) => {

    const handleError = (err) => {
        console.error(err)
    }

    const handleScan = (data) => {
        console.log(data)
    }

    return (
        <div> 
            <label>Scan New code here</label>
            <QrReader
                className = 'center'
                delay={200}
                onError={handleError}
                onScan={handleScan}
                style={{ width: '500px' }}
            />
        </div>
    )
}

export default Add;
